import Newsfeed from './pages/Newsfeed';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App () {
  return (
    <Router>
      <main>
        <Switch>
          <Route path='/'>
            <Newsfeed />
          </Route>
        </Switch>
        <Newsfeed />
      </main>
    </Router>
  );
}

export default App;
